Rising Stars: Bright
The first Rising Stars spin-off, a three-issue miniseries, written by Fiona Avery, penciled by Dan Jurgens and published in Feb-Apr 2003, is about Matthew Bright&amp;#039;s rookie years as a police officer in the NYPD under the name Brendan Miller, after he left Pederson.

Rising Stars: Voices Of The Dead
The six-issue miniseries Rising Stars: Voices Of The Dead features Lionel Zerb, a Special who can see dead people, and was published in Apr-Dec 2005. It was again written by Fiona Avery, with pencils by Staz Johnson and Al Rio.

Rising Stars: Untouchable
The five-issue miniseries Rising Stars: Untouchable features Laurel Darkhaven, a Special who worked for the CIA as an assassin. Written by Fiona Avery with pencils by Brent Anderson. Published February 2006 - June 2006.

